import React from "react";

class AddProduto extends React.Component{
    //criando configuraçoes
  state = {

  }

    render(){
        return(
            <div className ="ui main">
                <h2>Adicionar Produtos</h2>
                <form className = "ui form">
                    <div className = "field">
                        <label>Nome do produto</label>
                        <input type ="text" name = "name" placeholder = "Calça Jeans"/>
                    </div>

                    <div className = "field">
                        <label>Preço do Produto</label>
                        <input type ="text" name = "name" placeholder = "18.00"/>
                    </div>

                    <div className = "field">
                        <label>Tamanho do Produto</label>
                        <input type ="text" name = "name" placeholder = "XML"/>
                    </div>

                    <div className = "field">
                        <label>Cor do Produto</label>
                        <input type ="text" name = "name" placeholder = "Cinza"/>
                    </div>
                    <button className ="ui button blue">Adicionar</button>
                </form>
            </div>
        );
    }

}

export default AddProduto;
